import Auth from "@/models/Auth";
import axios from "axios";

export default (to, from, next) => {
  axios.get('validate-token').catch(function (error) {
    if (error.response) {

    }
  });

  // If user not logged in
  if( !Auth.check() ) {
    next({ name: 'login' });
  }
}
